import React from 'react'
import Todo from './Todo'

const Todolist = ({todos}) => {

    return (
        <div>
            <ul>
                {todos.map(todo => (
                    <Todo 
                    text = {todo.title}
                    key = {todo.id}
                    />
                ))}
            </ul>
        </div>
    )
}

export default Todolist;
